import Styled, { css } from 'styled-components';
import { Link } from 'react-router-dom';

export const HeaderContainer = Styled.div`
    display: flex;
    justify-content: space-between;
    width: 100%;
    height: 70%;
    margin-bottom: 25px;
`;

export const LogoContainer = Styled(Link)`
    height: 100%;
    width:75%;
    padding: 25px;
`;
